import ExpenseIte from './Components/ExpenseItem';


function App(amount, title, date) {
  const expenses = [
    { title: 'BEER', amount: 2000, date: new Date(2021, 5, 28) },
    { title: 'MILK', amount: 1999, date: new Date(2021, 5, 27) },
    { title: 'SODA', amount: 1998, date: new Date(2021, 5, 26) },
    { title: 'JUICE', amount: 1997, date: new Date(2021, 5, 25) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>
      <ExpressItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      />
      <ExpressItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      />
      <ExpressItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      />
      <ExpressItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      />
    </div>
  );
}

export default App;
